import React from 'react'
import { bindActionCreators } from "redux";
import classes from './User.module.css'
import { connect } from "react-redux";
import { requestApiUser } from "../../../actions";


class User extends React.Component {

  componentDidMount() {
    this.props.requestApiUser(this.props.userId);
  }

  render() {
    console.log('2!NEW USER:', this.props.userData.userData)
    return (
      <div className={classes.User}>{this.props.userId}
        {(this.props.userData.userData || []).map((key,index)=>{
          return (
            <div>d{key.name}</div>
          )
        })}
      </div>
    )
  }
}
const mapStateToProps = state => {
  return {
    userData: state.data
  }
}

const mapDispatchToProps = (dispatch) => {
  return {
    requestApiUser: (id)=>{dispatch(requestApiUser(id))},
  }
}


export default connect(mapStateToProps, mapDispatchToProps)(User)
